import React from 'react'

import { Ox } from "./Ox"
import "./Oard.css"

export const Oard = ({ Oard, onClick }) => {
  return (
    <div className="Oard">
      {
        Oard.map((value, idx) => {
          return <Ox value={value} onClick={() => value === null && onClick(idx)} />;
        })
      }
    </div>
  )
}
